import react from "react";


export default function Vote({title, options}) {
    return (
        <div>
            <h1>{title}</h1>
            <button>{options[0]}</button><br></br>
            <button>{options[1]}</button><br></br>
            <button>{options[2]}</button>
            <button>{options[3]}</button>
        </div>
    )
}
